import React from 'react'
import '../src/navbar.css';

function NavBar() {
    return (
        <div>
  <ul>
  <li className="navbar-li"><a class="active" href="#home">Home</a></li>
  <li className="navbar-li"><a href="#news">Users</a></li>
  <li className="navbar-li"><a href="#contact">Contact</a></li>
</ul>
        </div>
    )
}

export default NavBar
